import "firebase/auth";
import app from "firebase/app";
import {
  Flex,
  Input,
  FormControl,
  FormLabel,
  Box,
  Button,
} from "@chakra-ui/react";

const Login = () => {
  const auth = app.auth();

  const onClickSignUp = async (ev) => {
    try {
      const res = await auth.signInWithCustomToken("token");
      console.log(res);
    } catch (err) {
      console.log("err: ", err);
    }
  };

  return (
    <Flex
      height={"100%"}
      justifyContent={"center"}
      alignItems={"center"}
      flexDirection={"column"}
    >
      <Box>
        <FormControl id="email">
          <FormLabel>Correo Electrónico</FormLabel>
          <Input type="email" />
        </FormControl>
        <FormControl id="email">
          <FormLabel>Correo Electrónico</FormLabel>
          <Input type="email" />
        </FormControl>
        <Button colorScheme="blue" onClick={onClickSignUp}>
          Registrarte
        </Button>
      </Box>
    </Flex>
  );

  // const onClick = async (ev) => {
  //   try {
  //     const res = await auth.signInWithCustomToken("token");
  //     console.log(res);
  //   } catch (err) {
  //     console.log("err: ", err);
  //   }
  // };

  // console.log("firebase: ", auth);
};

export default Login;
